import React from 'react';
import PropTypes from 'prop-types';

const whitePixel = 'data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7';

// Pure UI component for displaying a student photo
export default class MockStudentPhoto extends React.Component {

  altText() {
    return 'Mock student photo';
  }

  onError(e) {
    e.target.src = whitePixel;
  }

  render() {
    const {height, width, style} = this.props;

    return (
      <img
        style={style}
        src={fixtureImage}
        width={width}
        height={height}
        alt={this.altText()}
        onError={this.onError}
      />
    );
  }
}

MockStudentPhoto.propTypes = {
  student: PropTypes.shape({
    id: PropTypes.number.isRequired
  }).isRequired,
  width: PropTypes.number,
  height: PropTypes.number,
  style: PropTypes.object,
};


const fixtureImage = `data:image/png;base64,`;